import React, { useEffect, useState } from "react";
import Button from "react-bootstrap/Button";
import { NavLink } from "react-router-dom";
import axios from "axios";
import Table from "react-bootstrap/Table";
import 'material-icons/css/material-icons.css';
export default function Home() {
  const [data, setData] = useState([]);
  const [page, setPage] = useState(1); // Current page
  
  const getUserData = async () => {
    try {
      const response = await axios.get(
        `http://localhost:3001/loan?page=${page}`,
        {
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      // Update the state with the paginated data
      setData(response.data);
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    getUserData();
  }, [page]);
  

  const goToPage = (newPage) => {
    setPage(newPage);
  };

  return (
    <div className="container mt-2">
      <h2 className="text-center mt-2">Loan Details</h2>
      <div className="text-end">
        <Button variant="dark">
          <NavLink to="/AddLoan" className="text-decoration-none text-light">
            Add Loan
          </NavLink>
        </Button>
      </div>
      <div className="row d-flex align-items-center mt-5">
        <Table striped>
          <thead>
            <tr>
              <th>LoanID</th>
              <th>CustomerID</th>
              <th>Loan Amount</th>
              <th>Duration</th>
              <th>Status</th>
              <th>Start Day</th>
              <th>More ...</th>
            </tr>
          </thead>
          <tbody>
            {data.map((el, i) => (
              <tr key={i}>
                <td>{el.loanId}</td>
                <td>{el.customerId}</td>
                <td>$ {el.amount}</td>
                <td>{el.duration}</td>
                <td>{el.status}</td>
                <td>{new Date(el.date).toLocaleDateString()}</td>
                <td>
                  <Button variant="dark">
                  <NavLink to={`/details/${el.loanId}`} className="text-decoration-none text-light">

                      Details
                    </NavLink>
                  </Button>
                </td>
                <td>
                               <a href="#" class="view" title="View" data-toggle="tooltip" style={{color:"#10ab80"}}><i class="material-icons">&#xE417;</i></a>
                                <a href="#" class="edit" title="Edit" data-toggle="tooltip"><i class="material-icons">&#xE254;</i></a>
                                <a href="#" class="delete" title="Delete" data-toggle="tooltip" style={{color:"red"}}><i class="material-icons">&#xE872;</i></a>
                                 
                            </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
      <div className="text-center">
        <Button variant="light" onClick={() => goToPage(page - 1)}>
          {page}
        </Button>{" "}
        <Button variant="light" onClick={() => goToPage(page + 1)}>
        {page+1}
        </Button>
      </div>
    </div>
  );
}
